# Part 2
line = input()

shortest = len(line) * 2

for remove in "abcdefghijklmnopqrstuvwxyz":

    stack = [' ']

    for c in line:
        if c.lower() != remove:
            if stack[-1].isupper() and c == stack[-1].lower() or c.isupper() and c.lower() == stack[-1]:
                stack.pop()
            else:
                stack.append(c)

    if len(stack) - 1 < shortest:
        shortest = len(stack) - 1

print(shortest)